def __eq__(self, other):
    if not isinstance(other, Join):
        return NotImplemented
    return self.identity == other.identity

def __str__(self):
    return ":".join(
        (
            self.__class__.__name__,
            self.summary,
        )
    )

def __setitem__(self, key: str, value: Any) -> None:
    if key not in self._get_included_keys():
        raise KeyError(f"Invalid key: {key}")
    setattr(self, key, value)

def __str__(self):
    kwargs_str = ', '.join([
        '%s=%s' % (key, value)
        for key, value in sorted(self._kwargs.items())
    ])
    return '<MockObject %s>' % kwargs_str

def __getattr__(self, key: str) -> Any:
    """Proxy all other undefined accessors to the underlying
    implementation."""
    return getattr(self.impl_instance, key)

def field_to_schema(field):
    title = force_str(field.label) if field.label else ''
    description = force_str(field.help_text) if field.help_text else ''

    if isinstance(field, (serializers.ListSerializer, serializers.ListField)):
        child_schema = field_to_schema(field.child)
        return coreschema.Array(
            items=child_schema,
            title=title,
            description=description
        )
    elif isinstance(field, serializers.DictField):
        return coreschema.Object(
            title=title,
            description=description
        )
    elif isinstance(field, serializers.Serializer):
        return coreschema.Object(
            properties={
                key: field_to_schema(value)
                for key, value
                in field.fields.items()
            },
            title=title,
            description=description
        )
    elif isinstance(field, serializers.ManyRelatedField):
        related_field_schema = field_to_schema(field.child_relation)

        return coreschema.Array(
            items=related_field_schema,
            title=title,
            description=description
        )
    elif isinstance(field, serializers.PrimaryKeyRelatedField):
        schema_cls = coreschema.String
        model = getattr(field.queryset, 'model', None)
        if model is not None:
            model_field = model._meta.pk
            if isinstance(model_field, models.AutoField):
                schema_cls = coreschema.Integer
        return schema_cls(title=title, description=description)
    elif isinstance(field, serializers.RelatedField):
        return coreschema.String(title=title, description=description)
    elif isinstance(field, serializers.MultipleChoiceField):
        return coreschema.Array(
            items=coreschema.Enum(enum=list(field.choices)),
            title=title,
            description=description
        )
    elif isinstance(field, serializers.ChoiceField):
        return coreschema.Enum(
            enum=list(field.choices),
            title=title,
            description=description
        )
    elif isinstance(field, serializers.BooleanField):
        return coreschema.Boolean(title=title, description=description)
    elif isinstance(field, (serializers.DecimalField, serializers.FloatField)):
        return coreschema.Number(title=title, description=description)
    elif isinstance(field, serializers.IntegerField):
        return coreschema.Integer(title=title, description=description)
    elif isinstance(field, serializers.DateField):
        return coreschema.String(
            title=title,
            description=description,
            format='date'
        )
    elif isinstance(field, serializers.DateTimeField):
        return coreschema.String(
            title=title,
            description=description,
            format='date-time'
        )
    elif isinstance(field, serializers.JSONField):
        return coreschema.Object(title=title, description=description)

    if field.style.get('base_template') == 'textarea.html':
        return coreschema.String(
            title=title,
            description=description,
            format='textarea'
        )

    return coreschema.String(title=title, description=description)

def as_string(value):
    if value is None:
        return ''
    return '%s' % value

def as_set(self, preserve_casing: bool = False) -> set[str]:
    """Return the set as real python set type.  When calling this, all
    the items are converted to lowercase and the ordering is lost.

    :param preserve_casing: if set to `True` the items in the set returned
                            will have the original case like in the
                            :class:`HeaderSet`, otherwise they will
                            be lowercase.
    """
    if preserve_casing:
        return set(self._headers)
    return set(self._set)

def visit_function(self, func, **kw):
    text = super().visit_function(func, **kw)
    if kw.get("asfrom", False) and func.name.lower() != "table":
        text = "TABLE (%s)" % text
    return text

def results_iter(
    self,
    results=None,
    tuple_expected=False,
    chunked_fetch=False,
    chunk_size=GET_ITERATOR_CHUNK_SIZE,
):
    """Return an iterator over the results from executing this query."""
    if results is None:
        results = self.execute_sql(
            MULTI, chunked_fetch=chunked_fetch, chunk_size=chunk_size
        )
    fields = [s[0] for s in self.select[0 : self.col_count]]
    converters = self.get_converters(fields)
    rows = chain.from_iterable(results)
    if converters:
        rows = self.apply_converters(rows, converters)
    if self.has_composite_fields(fields):
        rows = self.composite_fields_to_tuples(rows, fields)
    if tuple_expected:
        rows = map(tuple, rows)
    return rows

def visit_mod_binary(self, binary, operator, **kw):
    return "mod(%s, %s)" % (
        self.process(binary.left, **kw),
        self.process(binary.right, **kw),
    )

def bind_processor(self, dialect):
    impl_processor = super().bind_processor(dialect) or (
        lambda value: value
    )

    def process(value):
        if value is None:
            value = "<null value>"

        return "BIND_IN" + impl_processor(value)

    return process

async def dispatch_queue_batch(loader, queue):
    # Collect all keys to be loaded in this dispatch
    keys = [loaded.key for loaded in queue]

    # Call the provided batch_load_fn for this loader with the loader queue's keys.
    batch_future = loader.batch_load_fn(keys)

    # Assert the expected response from batch_load_fn
    if not batch_future or not iscoroutine(batch_future):
        return failed_dispatch(  # pragma: no cover
            loader,
            queue,
            TypeError(
                (
                    "DataLoader must be constructed with a function which accepts "
                    "Iterable<key> and returns Future<Iterable<value>>, but the function did "
                    "not return a Coroutine: {}."
                ).format(batch_future)
            ),
        )

    try:
        values = await batch_future
        if not isinstance(values, Iterable):
            raise TypeError(  # pragma: no cover
                (
                    "DataLoader must be constructed with a function which accepts "
                    "Iterable<key> and returns Future<Iterable<value>>, but the function did "
                    "not return a Future of a Iterable: {}."
                ).format(values)
            )

        values = list(values)
        if len(values) != len(keys):
            raise TypeError(  # pragma: no cover
                (
                    "DataLoader must be constructed with a function which accepts "
                    "Iterable<key> and returns Future<Iterable<value>>, but the function did "
                    "not return a Future of a Iterable with the same length as the Iterable "
                    "of keys."
                    "\n\nKeys:\n{}"
                    "\n\nValues:\n{}"
                ).format(keys, values)
            )

        # Step through the values, resolving or rejecting each Future in the
        # loaded queue.
        for loaded, value in zip(queue, values):
            if isinstance(value, Exception):
                loaded.future.set_exception(value)
            else:
                loaded.future.set_result(value)

    except Exception as e:
        return failed_dispatch(loader, queue, e)

def open_reader(self, artifact_id: str) -> BinaryIO:
    for i in range(self._max_retries):
        try:
            return self._backend.open_reader(artifact_id)
        except ArtifactNotFound:
            raise
        except Exception as e:
            if i == self._max_retries - 1:
                raise
            else:
                _logger.error(f"Failed to open artifact={artifact_id} n_retry={i}", exc_info=e)
        time.sleep(self._get_sleep_secs(i))
    assert False, "must not reach here"

def bind_processor(
    self, dialect: Dialect
) -> Optional[_BindProcessorType[Any]]:
    datetime_datetime = datetime.datetime
    datetime_date = datetime.date
    format_ = self._storage_format

    def process(value):
        if value is None:
            return None
        elif isinstance(value, datetime_datetime):
            return format_ % {
                "year": value.year,
                "month": value.month,
                "day": value.day,
                "hour": value.hour,
                "minute": value.minute,
                "second": value.second,
                "microsecond": value.microsecond,
            }
        elif isinstance(value, datetime_date):
            return format_ % {
                "year": value.year,
                "month": value.month,
                "day": value.day,
                "hour": 0,
                "minute": 0,
                "second": 0,
                "microsecond": 0,
            }
        else:
            raise TypeError(
                "SQLite DateTime type only accepts Python "
                "datetime and date objects as input."
            )

    return process

def dumps(self, obj):
    """
    The parameter is an already serialized list of Message objects. No need
    to serialize it again, only join the list together and encode it.
    """
    return ("[" + ",".join(obj) + "]").encode("latin-1")

