def is_url(
    url: str,
    allowed_schemas: tuple[UrlSchema, ...] = ("http", "https"),
) -> bool:
    """Check if a string looks like an URL.

    This doesn't check if the URL is actually valid or reachable.

    Parameters
    ----------
    url : str
        The URL to check.

    allowed_schemas : Tuple[str]
        The allowed URL schemas. Default is ("http", "https").
    """
    try:
        result = urlparse(str(url))
        if result.scheme not in allowed_schemas:
            return False

        if result.scheme in ["http", "https"]:
            return bool(result.netloc)
        if result.scheme in ["mailto", "data"]:
            return bool(result.path)

    except ValueError:
        return False
    return False

def parse(self, response):
    self.meta.setdefault("responses", []).append(response)
    if callable(self.callback_func):
        return self.callback_func(response)
    if "next" in response.meta:
        return response.meta["next"]
    return None

