        "TOUCH|OVERLAPBDYDISJOINT|OVERLAPBDYINTERSECT|EQUAL|INSIDE|COVEREDBY|"
        "CONTAINS|COVERS|ANYINTERACT|ON"
    )
    mask_regex = re.compile(r"^(%s)(\+(%s))*$" % (masks, masks), re.I)
